import './SideNav.css';

function SideNav(props) {
   openNav = () => {
      this.setState({
          navwidth: '250px'
      });
  }

  closeNav = () => {
      this.setState({
          navwidth: '0px'
      });
  }
   return (

      <div className="sideNav" style={{ width: props.width, paddingTop: "30px" }}>
         <div className="bi-x-circle-fill closebtn" onClick={this.closeNav}></div>
         <a href='#Section'>Sales</a>
         <a href="#Section">Admin</a>
         <a href="#Section">Warehouse</a>
         <a href="#Section">Supplier</a>

      </div>
   );
}
export default SideNav;
